import React from 'react';
import './Login.scss'

const Login = () => {
    return(
        <div className="Login">
            <h4>LOGOWANIE</h4>
            <div>
                <label for="login">Login:</label>
                <input type="text" name="login"/>
                <label for="password">Password:</label>
                <input type="password" name="pass"/>
            </div>
        </div>
    )
}

export default Login;
